import { useState } from 'react';
import './App.css';

const Cipher = () => {
  const [text, setText] = useState('');
  const [encrypted, setEncrypted] = useState('');
  const [decrypted, setDecrypted] = useState('');
  const [key, setKey] = useState('');
  const [letterFrequencies, setLetterFrequencies] = useState({});

  const handleTextChange = (e) => {
    setText(e.target.value);
  };

  const handleAnalyze = () => {
    const textArray = text.split('');
    const frequency = {};

    for (const letter of textArray) {
      if (letter.match(/[a-zA-Z]/)) {
        const lowerCaseLetter = letter.toLowerCase();
        frequency[lowerCaseLetter] = (frequency[lowerCaseLetter] || 0) + 1;
      }
    }

    const sortedFrequency = Object.keys(frequency).sort((a, b) => frequency[b] - frequency[a]);
    const keyLetter = sortedFrequency[0];

    setLetterFrequencies(frequency);
    setKey(keyLetter);
  };

  const handleEncrypt = () => {
    const textArray = text.split('');
    const mostFrequentChar = key; // Use the most frequent character as the key
    const encryptedText = textArray.map(char => {
      if (char.match(/[a-zA-Z]/)) {
        return mostFrequentChar; // Replace with the most frequent character
      }
      return char; // Keep non-alphabetic characters unchanged
    }).join('');

    setEncrypted(encryptedText);
  };

  const handleDecrypt = () => {
    const encryptedArray = encrypted.split('');
    const mostFrequentChar = key; // Use the most frequent character as the key
    const decryptedText = encryptedArray.map(char => {
      if (char === mostFrequentChar) {
        return 'X'; // Replace back to a placeholder (or original character if known)
      }
      return char; // Keep non-matching characters unchanged
    }).join('');

    setDecrypted(decryptedText);
  };

  return (
    <div className="container mx-auto p-4 pt-6 mt-10">
      <h1 className="text-3xl font-bold mb-4">Double Transposition Cipher</h1>
      <div className="flex flex-col mb-4">
        <label className="text-lg font-bold mb-2">Text:</label>
        <textarea
          className="p-2 border border-gray-400 rounded"
          value={text}
          onChange={handleTextChange}
          rows={10}
          cols={50}
        />
      </div>
      <div className="flex flex-row mb-4">
        <button
          className="bg-blue-500 hover:bg-blue-700 text-white font-bold py-2 px-4 rounded mr-4"
          onClick={handleAnalyze}
        >
          Analyze
        </button>
        <button
          className="bg-blue-500 hover:bg-blue-700 text-white font-bold py-2 px-4 rounded mr-4"
          onClick={handleEncrypt}
        >
          Encrypt
        </button>
        <button
          className="bg-blue-500 hover:bg-blue-700 text-white font-bold py-2 px-4 rounded"
          onClick={handleDecrypt}
        >
          Decrypt
        </button>
      </div>
      <div className="flex flex-col mb-4">
        <label className="text-lg font-bold mb-2">Encrypted Text:</label>
        <textarea
          className="p-2 border border-gray-400 rounded"
          value={encrypted}
          rows={10}
          cols={50}
          readOnly
        />
      </div>
      <div className="flex flex-col mb-4">
        <label className="text-lg font-bold mb-2">Decrypted Text:</label>
        <textarea
          className="p-2 border border-gray-400 rounded"
          value={decrypted}
          rows={10}
          cols={50}
          readOnly
        />
      </div>
      <div className="flex flex-col mb-4">
        <label className="text-lg font-bold mb-2">Key:</label>
        <input
          className="p-2 border border-gray-400 rounded"
          type="text"
          value={key}
          readOnly
        />
      </div>
      <div className="flex flex-col mb-4">
        <label className="text-lg font-bold mb-2">Letter Frequencies:</label>
        <ul>
          {Object.keys(letterFrequencies).map((letter, index) => (
            <li key={index}>
              {letter}: {letterFrequencies[letter]}
            </li>
          ))}
        </ul>
      </div>
    </div>
  );
};

export default Cipher;
